CREATE TABLE IF NOT EXISTS "products_feature" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "modelbank" bool NOT NULL, "journey_id" bigint NOT NULL REFERENCES "products_journey" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_subfeature" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "feature_id" bigint NOT NULL REFERENCES "products_feature" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_version" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_release" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "release_date" date NOT NULL, "journey_id" bigint NULL REFERENCES "products_journey" ("id") DEFERRABLE INITIALLY DEFERRED, "version_id" bigint NULL REFERENCES "products_version" ("id") DEFERRABLE INITIALLY DEFERRED);
