CREATE TABLE IF NOT EXISTS "products_assignee" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_team" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "products_project" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL, "key" varchar(20) NOT NULL, "counter" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "products_assignee_journeys" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "assignee_id" bigint NOT NULL REFERENCES "products_assignee" ("id") DEFERRABLE INITIALLY DEFERRED, "journey_id" bigint NOT NULL REFERENCES "products_journey" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_project_journeys" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "project_id" bigint NOT NULL REFERENCES "products_project" ("id") DEFERRABLE INITIALLY DEFERRED, "journey_id" bigint NOT NULL REFERENCES "products_journey" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_team_journeys" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "team_id" bigint NOT NULL REFERENCES "products_team" ("id") DEFERRABLE INITIALLY DEFERRED, "journey_id" bigint NOT NULL REFERENCES "products_journey" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "products_vendor_journeys" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "vendor_id" bigint NOT NULL REFERENCES "products_vendor" ("id") DEFERRABLE INITIALLY DEFERRED, "journey_id" bigint NOT NULL REFERENCES "products_journey" ("id") DEFERRABLE INITIALLY DEFERRED);
